import React, {Component} from 'react';
import axios from 'axios';
import Items from './Components/Items'

import './App.css';

class App extends Component {
    state = {
        items: [
            {
                id: 1,
                title: "item 1",
                description: "item 1",
                price: 12.45
            },
            {
                id: 2,
                title: "item 2",
                description: "item 2",
                price: 11.56
            }
        ]

    }

    componentDidMount() {
        axios.get(`https://cors-anywhere.herokuapp.com/http://localhost:3452/item`).then(res => console.log(res.data)).catch(err => console.log(err));
    }

    render() {
        return (
            <div className="App">
                <Items items={this.state.items}/>
            </div>
        );
    }
}

export default App;
